import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className='App'>
        <Routes>
          <Route path='/' element={<AddPolicy/>}/>
          <Route path='/EditPolicy/:id' element={<EditPolicy/>}/>
          <Route path='/GetPolicy' element={<GetPolicy/>}/>
        </Routes>  
      </div>
    </Router>
  );
}

export default App;
